export function uriToJson(uri){
    const jsonParams=uri.replace(/&/g,'","').replace(/=/g,'":"').replace(/\?/g,"");
    if(jsonParams){
        return JSON.parse('"{'+jsonParams+'}"');
    }
    return {};
}
